import React from 'react';

function DataAccess() {
  return (
    <div>
      <h2>Acceso a los datos de PACE</h2>
      <h3>Recursos de datos de PACE</h3>
      <h3>Opciones para acceder a los datos de PACE</h3>
      <h3>Acceso por nivel de madurez</h3>
      <h3>Productos derivados adicionales</h3>
    </div>
  );
}

export default DataAccess;
